import React, { Component } from "react";
import { Switch, Route, useRouteMatch } from "react-router-dom";

import RulesIngestion from "./rules-ingestion";
import Navbar from "../../common/navbar";
import "./extractionContainer.scss";

class ExtractionContainer extends Component {
  state = {
    tabs: [
      {
        _id: 1,
        title: "dashboard",
        path: "",
      },
      {
        _id: 2,
        title: "ingestion",
        path: "",
      },
      {
        _id: 3,
        title: "configuration",
        path: "",
      },
      {
        _id: 4,
        title: "execution",
        path: "",
      },
      {
        _id: 5,
        title: "views",
        path: "",
      },
    ],
  };

  componentDidMount() {
    const { url } = useRouteMatch();
    const tabs = [...this.state.tabs];
    tabs.map((tab) => (tab.path = `${url}/${tab.title}`));
    this.setState({ tabs });
  }

  render() {
    return (
      <div className="extraction-container">
        <div className="header">
          <Navbar tabs={this.state.tabs} />
        </div>
        <div className="rules-container">
          <h4>asdalskdaklsdlaksdm</h4>
          <Switch>
            <Route
              path="/rules-extraction/ingestion"
              exact
              component={RulesIngestion}
            />
          </Switch>
        </div>
      </div>
    );
  }
}

export default ExtractionContainer;
